import React, {useContext, useState} from 'react';
import api from '../../services/api';
import {GlobalContext} from '../../context/GlobalState';
import Navbar from '../../components/Navbar/Navbar';
import {Container} from '@material-ui/core';
import useForm from '../../customHooks/useForm';

interface ViaCep {
    bairro : string;
    cep : string;
    complemento : string;
    ddd : string;
    gia : string;
    ibge : string;
    localidade : string;
    logradouro : string;
    siafi : string;
    uf : string;
}

const Form = () => {
    const {viaCep} = useContext(GlobalContext);
    const [userCep,
        setUserCep] = useState < ViaCep | null > (viaCep);
    if (!viaCep) {
        throw new Error("Cep não encontrado.");
    }
    const {
        values,
        errors,
        touched,
        handleChange,
        handleBlur,
        handleSubmit
    } = useForm();

    return (
        <Container>
            <Navbar/>
            <form onSubmit={handleSubmit}>
                <input
                    name="name"
                    placeholder="Nome Completo"
                    value={values.name || ''}
                    required
                    maxLength={130}
                    onChange={handleChange}
                    onBlur={handleBlur}/>
                <input
                    name="cpf"
                    required
                    maxLength={11}
                    pattern="[0-9]{11}"
                    placeholder="Cpf, deve conter apenas números"
                    value={values.cpf || ''}
                    onChange={handleChange}
                    onBlur={handleBlur}/>
                <input
                    name="email"
                    placeholder="Email"
                    required
                    pattern="[a-zA-Z0-9._-]{1,64}@[a-zA-Z0-9.-]{1,}\.[a-zA-Z]{2,}"
                    value={values.email || ''}
                    onChange={handleChange}
                    onBlur={handleBlur}/>
                <input
                    name="cep"
                    placeholder="Cep, deve conter apenas números..."
                    pattern="[0-9]{8}"
                    required
                    value={values.cep || userCep?.cep}
                    onChange={handleChange}
                    onBlur={handleBlur}/>
                <input
                    name="neighborhood"
                    placeholder="Bairro"
                    required
                    value={values.neighborhood || userCep?.bairro}
                    onChange={handleChange}
                    onBlur={handleBlur}/>

                <input
                    name="city"
                    placeholder="Cidade"
                    required
                    value={values.city || userCep?.localidade}
                    onChange={handleChange}
                    onBlur={handleBlur}/>

                <input
                    name="street"
                    placeholder="Rua"
                    required
                    value={values.street || userCep?.logradouro}
                    onChange={handleChange}
                    onBlur={handleBlur}/>

                <input
                    name="complement"
                    placeholder="Complemento"
                    value={values.complement || ''}
                    onChange={handleChange}
                    onBlur={handleBlur}/>

                <input
                    name="state"
                    placeholder="Estado"
                    value={values.state || userCep?.uf}
                    onChange={handleChange}
                    onBlur={handleBlur}/>
                <input
                    name="number"
                    placeholder="Número"
                    value={values.number || ''}
                    onChange={handleChange}
                    onBlur={handleBlur}/>
                <button>Enviar Cadastro</button>
            </form>
        </Container>
    );
};

export default Form;
